static int sctp_write(URLContext *h, const uint8_t *buf, int size)

{

    SCTPContext *s = h->priv_data;

    int ret;



    if (!(h->flags & AVIO_FLAG_NONBLOCK)) {

        ret = sctp_wait_fd(s->fd, 1);

        if (ret < 0)

            return ret;

    }



