    size1 = size;

    while (size > 0) {

        if (url_interrupt_cb())

            return -EINTR;

        fd_max = s->fd;

        FD_ZERO(&rfds);

        FD_SET(s->fd, &rfds);

        tv.tv_sec = 0;

        tv.tv_usec = 100 * 1000;

        select(fd_max + 1, &rfds, NULL, NULL, &tv);

#ifdef __BEOS__

